import React from 'react';
import './ExcelTa.css'; // Optional: For styling

function ExcelTable({ data }) {
  // Reusable function to render a table
  const renderTable = (title, records) => {
    if (!records || records.length === 0) return null;

    return (
      <div className="table-section">
        <h2>{title}</h2>
        <table className="excel-table">
          <thead>
            <tr>
              {Object.keys(records[0]).map((key) => (
                <th key={key}>{key}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {records.map((row, index) => (
              <tr key={index}>
                {Object.values(row).map((cell, idx) => (
                  <td key={idx}>{cell}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  return (
    <div className="excel-container">
      {renderTable('All Orders', data?.allOrders)}
      {renderTable('Pending Orders', data?.pending)}
      {renderTable('Cancelled Orders', data?.cancel)}
      {renderTable('Delivered Orders', data?.deliver)}
      {renderTable('Returned Orders', data?.return)}
    </div>
  );
}

export default ExcelTable;
